import React,{Component} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Body-navbar.css';
import {
  BrowserRouter as Router,
   Link,Route
} from "react-router-dom";
import Home from '../Out/Home/Home';
class Bodynavbar extends Component {
  render(){
  return (
    <Router>
      <div class="navbar1">
        <Link to="/"><i class="fas fa-home"></i></Link>
        <div class="subnav">
          <button class="subnavbtn">Áo </button>
          <div class=" subnav-content ">
            <div className="row">
              <a className="col-6">
                <div className="abc1">
                <Link to="/"><i class="fas fa-home"></i></Link></div>
                <div className="abcd">Sản phẩm mới</div>
                <div className="abcd">Áo sơ mi</div>
                <div className="abcd">Áo thun</div>
                <div className="abcd">Áo khoác</div>
              </a>
              <a className="col-6">
                <img className="img1"  src="http://localhost:4000/anh/menu-ao-92w"></img>
              </a>
            </div>
          </div>
        </div>
      </div>
    </Router>
  );
}}

export default Bodynavbar;
